using namespace std;

struct pair_hash {
    template <class T1, class T2>
    std::size_t operator() (const std::pair<T1, T2> &pair) const {
        return std::hash<T1>()(pair.first) ^ std::hash<T2>()(pair.second);
    }
};

struct UF_grid {
	vector<int> e;
  int r; int c;
	UF_grid(int _r, int _c, int n) {
    r = _r; c = _c;
    e = vector<int>(r*c+n, -1);
  }
  int conv(int x, int y) {
    if (x < 0) return r*c - 1 - x;
    return x*c + y;
  }
	bool sameSet(int a, int b) { return find(a) == find(b); }
	int find(int x) { return e[x] < 0 ? x : e[x] = find(e[x]); }
	bool join(int a, int b) {
		a = find(a), b = find(b);
		if (a == b) return false;
		if (e[a] > e[b]) swap(a, b);
		e[a] += e[b]; e[b] = a;
		return true;
	}

  bool sameSet(int a, int b, int c, int d) { return sameSet(conv(a, b), conv(c, d)); }
  int find(int a, int b) { return find(conv(a, b)); }
  bool join(int a, int b, int c, int d) { return join(conv(a, b), conv(c, d)); }
};

class Solution {
public:
  int row;
  int col;

  int latestDayToCross(int _row, int _col, vector<vector<int>>& cells) {

    row = _row; col = _col;

    vector<vector<int>> grid;
    for (int i=0; i<row; i++) {
      vector<int> r;
      grid.push_back(vector<int>(col, 1));
    }


    auto uf = UF_grid(row, col, 2);

    for (int i=cells.size()-1;i>=0; i--) {
      auto xy = cells[i];
      int x = xy[0];
      int y = xy[1];
      x--; y--;

      if (x == 0) uf.join(-1, -1, x, y);
      if ((x+1 < row) && grid[x+1][y] == 0) uf.join(x, y, x+1, y);
      if ((y+1 < col) && grid[x][y+1] == 0) uf.join(x, y, x, y+1);
      if ((0 <= x-1) && grid[x-1][y] == 0) uf.join(x, y, x-1, y);
      if ((0 <= y-1) && grid[x][y-1] == 0) uf.join(x, y, x, y-1);
      if (x == row-1) uf.join(-2, -2, x, y);

      grid[x][y] = 0;

      if (uf.sameSet(-1, -1, -2, -2)) return i;
    }
    return 0;
  }
};


